// CONCATENATED MODULE: ./node_modules/vue-loader/lib/loaders/templateLoader.js??vue-loader-options!./node_modules/vue-loader/lib??vue-loader-options!./src/pages/peopledevelopment/index.vue?vue&type=template&id=28fca5e3&scoped=true&
var render = function () {var _vm=this;var _h=_vm.$createElement;var _c=_vm._self._c||_h;return _c('div',{staticClass:"page-pd"},[_c('BgTop'),_vm._ssrNode(" <div class=\"heading-en under-en-title\" data-v-28fca5e3>Personnel Training</div> <div class=\"pd__desc\" data-v-28fca5e3><h1 class=\"large-ja\" data-v-28fca5e3><span class=\"ja\" data-v-28fca5e3>ＢＦＴの人材育成とは</span></h1> <div class=\"desc__txt\" data-v-28fca5e3><div class=\"txt-bg\" data-v-28fca5e3></div> <div class=\"desc__txt__txt\" data-v-28fca5e3>\n                社会に出ると多くの人は失敗する可能性がある挑戦を避けたがります。そこにある「自分を良く見せたいと」いう思いは、無意識のうちに自分の能力や素質を限られたものにします。<br data-v-28fca5e3>\n                ＢＦＴの人材育成はエンジニアとして能力や素質を直接育てるのではなく、失敗してもよい場をつくり、そこでの挑戦の過程から「自分の能力を伸ばす」を教えています。<br data-v-28fca5e3>\n                そのため技術に限定しておらず、実践やより実践に近い体験を大切にしています。\n            </div></div></div> <h2 class=\"pd__heading-h2\" data-v-28fca5e3><span class=\"ja\" data-v-28fca5e3>カリキュラム</span></h2> <div class=\"pd__curs\" data-v-28fca5e3><div class=\"pd__curs__cur\" data-v-28fca5e3><div class=\"side-red\" data-v-28fca5e3></div> <h3 class=\"cur__title\" data-v-28fca5e3><span data-v-28fca5e3>【価値を提供する力】</span><br class=\"sp\" data-v-28fca5e3>\n                感動クリエーター育成プログラム\n            </h3> <ul class=\"cur__list\" data-v-28fca5e3><li class=\"cur__list__item\" data-v-28fca5e3>\n                    ＜キャリアデザイン研修＞<br data-v-28fca5e3>\n                    入社2年目をスタートするにあたり、キャリアとは何か、どのようにキャリアパスをデザインすればよいかを教えます。研修を受講すると、自分自身の強み、ビジョンや価値観、会社の期待を知ることができます。それらを知り、インプットにして自分の将来像を描く方法がわかります。加えて、スキルだけに目を向けるのではなく、社会人として、ＢＦＴ社員として、何を考え行動するべきかに目を向けることの大切さもわかります。\n                </li></ul></div> <div class=\"pd__curs__cur\" data-v-28fca5e3><div class=\"side-red\" data-v-28fca5e3></div> <h3 class=\"cur__title\" data-v-28fca5e3><span data-v-28fca5e3>【変化する気概】</span><br class=\"sp\" data-v-28fca5e3>\n                ダーウィン育成プログラム\n            </h3> <ul class=\"cur__list\" data-v-28fca5e3><li class=\"cur__list__item\" data-v-28fca5e3>\n                    ＜ビジネス企画プロジェクト＞<br data-v-28fca5e3>\n                    エンジニアとしてのクリエイティビティ向上を新規事業のプランニングで培います。要件定義よりさらに上流の工程を担当するには、ビジネス感覚を身につける必要があります。それは座学では身に付かず、本気で事業のプランニングを体験しないと身に付きません。このプロジェクトは、毎年、挙手により参加者を募り、チームに分かれて新規事業をプランニングします。社会の変化を把握することから始まり、マーケティングや収支計画を考え、役員向けのプレゼンも行います。<br data-v-28fca5e3><br data-v-28fca5e3></li> <li class=\"cur__list__item\" data-v-28fca5e3>\n                    ＜英会話力向上プロジェクト＞<br data-v-28fca5e3>\n                    ここ数年間で海外プロジェクトが少しずつ増えてきました。システムエンジニアに英語でのコミュニケーションが求められる日は近いと感じています。ＢＦＴでは社員に無料でネイティブ講師との英会話レッスンを受講できるようにしています。早朝始業前の時間やランチタイムを使ってレッスンを受講でき、英語での基礎コミュニケーション能力を向上させることができます。加えて、レッスンを通して社員間の交流を深めることもできます。<br data-v-28fca5e3><br data-v-28fca5e3></li> <li class=\"cur__list__item\" data-v-28fca5e3>\n                    ＜新卒採用経験プロジェクト＞<br data-v-28fca5e3>\n                    ＢＦＴでは新卒採用を人事部だけが担当するのでなく、新卒採用を経験したいエンジニアにも担当させています。毎年、挙手により採用担当者を募り、新卒採用を1年間のプロジェクトに見立てて、プロジェクトの全工程を経験してもらいます。これによりプロジェクト推進の勘所が身に付きます。加えて、立場の異なる人（学生）を相手することで、相手の立場で考える想像力や相手の理解を促す説明力が身に付きます。<br data-v-28fca5e3><br data-v-28fca5e3></li> <li class=\"cur__list__item\" data-v-28fca5e3>\n                    ＜師範代養成＞<br data-v-28fca5e3>\n                    「ＢＦＴ道場」の研修の企画・開発と、その講師を務めてもらいます。「ＢＦＴ道場」の研修は、ただその技術に詳しい者が講師をしているのではなく、実際にプロジェクト経験のあるエンジニアが講師をしています。日ごろのプロジェクトで蓄えたITの知識や押さえておくべき重要ポイントを研修教材という形にして、その講師を務めてもらいます。講師をすることで指導力、プレゼン力、企画力を向上させることができます。<br data-v-28fca5e3><br data-v-28fca5e3></li></ul></div> <div class=\"pd__curs__cur\" data-v-28fca5e3><div class=\"side-red\" data-v-28fca5e3></div> <h3 class=\"cur__title\" data-v-28fca5e3><span data-v-28fca5e3>【やりきる気持ち】</span><br class=\"sp\" data-v-28fca5e3>\n                メロス育成プログラム\n            </h3> <ul class=\"cur__list\" data-v-28fca5e3><li class=\"cur__list__item\" data-v-28fca5e3>\n                    ＜トップガン＞<br data-v-28fca5e3>\n                    入社2年目からいきなりプロジェクトリーダーを経験してもらいます。小規模なチームのリーダーとなり、1年間に複数のプロジェクトでその推進や顧客折衝を経験してもらい、リーダーシップ、課題の分析と解決、品質コントロールを身に付けてもらいます。これは将来フロントに立ってプロジェクトをマネジメントできる人材の育成と、その者を通してＢＦＴの仕事の流儀や仕事に向かうマインドが他の社員に伝播されることを狙っています。<br data-v-28fca5e3><br data-v-28fca5e3></li> <li class=\"cur__list__item\" data-v-28fca5e3>\n                    ＜ＢＦＴ出版部＞<br data-v-28fca5e3>\n                    システムエンジニアの最も重要な成果物は設計書です。文章で伝える力が低く、設計書の品質が低いと、システム停止につながるバグを作り出すこともあります。ＢＦＴではエンジニアのライティング力を高めるため、「みんながライター」のスローガンのもと、希望する社員にウェブサイトへの技術記事の寄稿や技術書籍の執筆をしてもらっています。これには自身の経験や知識を世の多くの人に伝えるという意義もあります。\n                </li></ul></div> <div class=\"pd__curs__cur\" data-v-28fca5e3><div class=\"side-red\" data-v-28fca5e3></div> <h3 class=\"cur__title\" data-v-28fca5e3><span data-v-28fca5e3>【選ばれる魅力】</span><br class=\"sp\" data-v-28fca5e3>\n                リーダー育成プログラム\n            </h3> <ul class=\"cur__list\" data-v-28fca5e3><li class=\"cur__list__item\" data-v-28fca5e3>\n                    ＜ＢＦＴ組織力向上部＞<br data-v-28fca5e3>\n                    ＢＦＴでは年に4回、新入社員に社内イベントを企画・運営してもらっています。お客様のプロジェクトで失敗は許されません。ですが、社内プロジェクトならば失敗しても平気です。社内レクリエーションやCSR・SDGs活動などの社内イベントをチームで企画・運営する中で、チームワーク、リーダーシップ、フォロアーシップが身に付きます。新入社員に参加を強制するのではなく、希望者を募りプロジェクトチームを立ち上げます。\n                </li></ul></div></div>")],2)}
